import React from 'react';

function Dashboard({ onPageChange }) {
  const handleDataInputClick = () => {
    onPageChange('dataInput');
  };

  const handleDataQueryClick = () => {
    onPageChange('dataQuery');
  };

  return (
    <div>
      <h2>Dashboard!</h2>
      <button onClick={handleDataInputClick}>Go to Data Input</button>
      <button onClick={handleDataQueryClick}>Go to Data Query</button>
    </div>
  );
}

export default Dashboard;
